// import logo from './logo.svg';
import './App.css';
import NavBar from  './components/NavBar'
import News from './components/News';


import React, { Component } from 'react'
// import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,

} from "react-router-dom";

export default class App extends Component {

  render() {
    return (
      <div>
        <Router>
        <NavBar></NavBar>

        <Switch>
          <Route path="/">
          <News pageSize={5} country="in" category="general"></News>

          </Route>
          <Route path="/sports">
          <News pageSize={5} country="in" category="sports"></News>

          </Route>
          <Route path="/bussiness">
          <News pageSize={5} country="in" category="bussines"></News>

          </Route>
          <Route path="/entertainment">
          <News pageSize={5} country="in" category="entertainment"></News>

          </Route>
          <Route path="/health">
          <News pageSize={5} country="in" category="health"></News>

          </Route>
          <Route path="/science">
          <News pageSize={5} country="in" category="science"></News>

          </Route>
          <Route path="/technology">
          <News pageSize={5} country="in" category="technology"></News>

          </Route>


        </Switch>
        </Router>



      </div>
    )
  }
}
